import React from 'react'

export default function footer() {
  return (
    <div className='Footer'>
      <p className='developed'> Developed under </p>
      <a href="https://opensourcelabs.io/" target="_blank"><img className='oslabslogo' src="/images/oslabslogo.png" alt='oslabs logo'/>      </a>
    </div>
  )
}
